    "sep <- function(text, len = 50){\n",
    "    print(paste(replicate(len, '--'), collapse = \"\"))\n",
    "    print(paste(c(replicate(len/2 - nchar(text), '  '), text), collapse = \"\"))\n",
    "    print(paste(replicate(len, '--'), collapse = \"\"))\n",
    "}\n",
    "\n",
    "fig <- function(x, y){\n",
    "    options(repr.plot.width = x, repr.plot.height = y)\n",
    "}"
